awards:
[{'title': 'Kraft Heinz Oscar Award ', 'description': 'My Food Service team was awarded, because we closed 1 million euros sales gap within 3 months, despite the vacancies of a marketing manager and a sales manager in the team.', 'issuer': 'The KraftHeinz Company', 'date': {'month': 8, 'day': None, 'year': 2017}}, {'title': 'HAN Top Talent Award', 'description': 'The reasons why I was awarded are: 

1. Excellent academic performance;

2. The initiative to establish the start-up company--Mi4All V.O.F.

3. Initiating the new tradition in Arnhem Business School--"Cultural Food Experiences", in order to remove the communication barrier between teachers and students from different countries;

4. Great contribution to Art Project Bildung, where HAN involved students for its school environment construction for the very first time in recent years. This project gained external publicity from local media, due to the new cooperation model between student volunteers, artist and HAN;

5. Valuable commitment to local refugee projects.

6. Positive attempts to connect students in HAN with external organizations.', 'issuer': 'HAN University of Applied Sciences', 'date': {'month': 9, 'day': None, 'year': 2016}}, {'title': 'Propaedeutic Certificate', 'description': 'This certificate was awarded to me, because I passed all the study units in the first year with the 3rd highest average grade among students.', 'issuer': 'HAN University of Applied Sciences', 'date': {'month': 10, 'day': None, 'year': 2015}}, {'title': 'Excellent Volunteer in 2013', 'description': None, 'issuer': 'The Association of Community Volunteers in Luoshan', 'date': {'month': 12, 'day': None, 'year': 2013}}, {'title': 'Dream-fulfilling Scholarship (2014-2018)', 'description': "Due to my contribution to the environmental protection and philanthropy in my hometown, the entrepreneur from my hometown (Weng Xian Ding, one of the most important figures in Chinese capital market) decided to sponsor part of my study cost in Holland, through his company's charity program. ", 'issuer': 'Shenzhen New Industry Venture Capital Co., Ltd.', 'date': {'month': None, 'day': None, 'year': None}}, {'title': 'HAN Excellence Scholarship (2014-2018)', 'description': 'Reasons to win the scholarship: Outstanding academic performance.', 'issuer': 'HAN University of Applied Sciences', 'date': {'month': None, 'day': None, 'year': None}}]

